description:
This spectacular project is a very beautiful and stunning wedding project. On this project you can insert up-to 18 photos or 18 video footages, and 9 titles of your choice. On this project everything is editable. This comes with , animated flipping pages, animated flourishes, butterflies, and stunning design gold plated frames. This can be used for commercials, weddings, anniversaries, and love stories. This comes with pre-comps, so that you can easily add, customize your photos, video footage, and text. To add your photos and text, just click on the two folders called Add All Your Photos Here, Add All your Text Here, and replace the placeholders with your on own photos---it's that easy. The font that I have use is called BaroqueScript. This project is comparable with CS4 and CS5. 1920x1080

